import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about">
      <h1>About Us</h1>
      <img src="/assets/about-image.jpg" alt="About" />
      <p>This is a brief description about us.</p>
    </div>
  );
}

export default About;
